import React from 'react';
import Proof from './Proof.js';
import styled from 'styled-components';

const MainBlockDiv = styled.div`
    position: relative;
    top: 0px;
`



class MainBlock extends React.Component {
  render(){
    return (
        <MainBlockDiv>
            <Proof/>


        </MainBlockDiv>
    );
  }
}
export default MainBlock;
